import "../stylesheets/Quotes.css";

const Quotes = (props) => {
  console.log(props);

  const handleClick = (ev) => {
    const click = ev.currentTarget.value;
    props.handleClick(click);
  };
  const quotesData = props.data.map(() => {
    return (
      <div id="quote-box">
        <div id="text">
          <p>holi</p>
        </div>
        <div id="author">
          <p>holi</p>
        </div>
        <div id="house">
          <p>holi</p>
        </div>

        <div id="buttons">
          <div className="social-media">
            <a href="www.twitter.es" id="twet-quote">
              <span>
                <img className="logo" src={twitterIcon} alt="" />
              </span>
            </a>
          </div>
          <button id="new-quote" onClick={handleClick}>
            New Quote
          </button>
        </div>
      </div>
    );
  });
};

Quotes.propTypes = {};
export default Quotes;

